import React from 'react';

// Este é o componente principal. Ele carrega a tela do catálogo.
function App() {
  return (
    // Usa classes Tailwind: fundo preto (bg-gray-900), texto branco (text-white) e tela inteira (min-h-screen)
    <div className="min-h-screen bg-gray-900 flex flex-col items-center p-4 sm:p-8">
      
      {/* Header com o tema Laranja */}
      <header className="w-full max-w-4xl mb-12">
        <h1 className="text-4xl sm:text-5xl font-extrabold text-orange-500 border-b-4 border-orange-500 pb-2">
          Catálogo Ouro Branco
        </h1>
        <p className="text-lg mt-2 text-gray-400">
          Carregando dados dos produtos...
        </p>
      </header>

      {/* Conteúdo principal - Aqui os produtos serão listados */}
      <main className="w-full max-w-4xl text-center">
        
        {/* Este é o espaço reservado para a listagem dos produtos */}
        <div className="bg-gray-800 p-8 rounded-xl shadow-2xl">
          <p className="text-xl text-orange-300 animate-pulse">
            Carregando o Layout...
          </p>
        </div>

      </main>

      {/* Footer */}
      <footer className="mt-auto pt-8 text-sm text-gray-500">
        Desenvolvido para Ouro Branco | {new Date().getFullYear()}
      </footer>

    </div>
  );
}

export default App;
